function Items(){
    const [items, setItems] = useState([])

    useEffect(() => {
        fetch("http://localhost:3000/items")
        .then((r) => r.json())
        .then(setItems)
    },[])


    return (
        <div>
            <h1>Items</h1>
        </div>
    )
}

export default Items;
